import './bookingForm.css';

const BookingForm = () => {
  return (
    <div className="booking">
      <form>
        <label htmlFor="Name">
          Name: <input type="text" />
        </label>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default BookingForm;
